		#region 过滤词
		/// <summary>
		/// 是否包含过滤词
		/// </summary>
		/// <param name="text"></param>
		/// <returns></returns>
		public static bool Contain(string text)
		{
			if (string.IsNullOrEmpty(text)) return false;
			bool result = false;
			if (!result) result = Regex.IsMatch(text, filterWord6, RegexOptions.IgnoreCase | RegexOptions.Multiline);
			if (!result) result = Regex.IsMatch(text, filterWord5, RegexOptions.IgnoreCase | RegexOptions.Multiline);
			if (!result) result = Regex.IsMatch(text, filterWord4, RegexOptions.IgnoreCase | RegexOptions.Multiline);
			if (!result) result = Regex.IsMatch(text, filterWord3, RegexOptions.IgnoreCase | RegexOptions.Multiline);
			if (!result) result = Regex.IsMatch(text, filterWord2, RegexOptions.IgnoreCase | RegexOptions.Multiline);
			if (!result) result = Regex.IsMatch(text, filterWord1, RegexOptions.IgnoreCase | RegexOptions.Multiline);
			return result;
		}

		/// <summary>
		/// 过滤处理
		/// </summary>
		/// <param name="text">字符串</param>
		/// <param name="replacement">替换字符串</param>
		/// <returns>过滤处理后的字符串</returns>
		public static string Filter(string text, string replacement)
		{
			if (string.IsNullOrEmpty(text)) return string.Empty;
			return Regex.Replace(
				Regex.Replace(
				Regex.Replace(
				Regex.Replace(
				Regex.Replace(
				Regex.Replace(
				text
				, filterWord6, replacement, RegexOptions.IgnoreCase | RegexOptions.Multiline)
				, filterWord5, replacement, RegexOptions.IgnoreCase | RegexOptions.Multiline)
				, filterWord4, replacement, RegexOptions.IgnoreCase | RegexOptions.Multiline)
				, filterWord3, replacement, RegexOptions.IgnoreCase | RegexOptions.Multiline)
				, filterWord2, replacement, RegexOptions.IgnoreCase | RegexOptions.Multiline)
				, filterWord1, replacement, RegexOptions.IgnoreCase | RegexOptions.Multiline);
		}

		/// <summary>
		/// 过滤处理，替换字符串“*”
		/// </summary>
		/// <param name="text">字符串</param>
		/// <returns></returns>
		public static string Filter(string text)
		{
			return Filter(text, "*");
		}

